                                        {
                                        // dataset.jenis
                                        // bill.type
                                            // bill.nokp
                                        }960124095119
                                        </span>
                                </div>
                                
                                <div className="relative w-1/12 pr-4 flex-grow hidden lg:block">
                                        <span className="font-semibold uppercase text-base text-gray-700">
                                        {
                                        // dataset.jenis
                                        // bill.type
                                            // bill.nokp
                                        }Asyraf
                                        </span>
                                </div>
                                <div className="relative w-1/12 pr-4 flex-grow hidden md:block">
                                        <span className="font-semibold uppercase text-base md:text-sm  text-gray-700">
                                        {
                                        // dataset.jenis
                                        // bill.type
                                            // bill.nokp
                                        }Wan Mohd Asyraf Bin Wan Zawawi
                                        </span>
                                </div>
                                <div className="relative w-1/12 pr-4 flex-initial">
