                                    {
                                    // dataset.jenis
                                    // bill.type
                                        // bill.nokp
                                    }Active
                                    </span>
                                </div>
                                <div className="relative w-auto pl-4 flex-initial">
                                    <button onClick={(e) => handleDelete(e)}>
                                        <i className="far fa-trash-alt" style={{color:"red"}}></i>
                                    </button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </>
  );
}
